@lorealparis Women of Worth celebrates its 15 year anniversary tonight at 8pm ET/PT on NBC.

Each year #lorealpariswomenofworth celebrates the charitable contributions of 10 exceptional women who give back to their communities. This year's honorees are recognized for causes including providing affordable education to indigenous communities, and aiding active duty women seeking assistance for PTSD.

Join us tonight to honour this years #WomenofWorth 🙏@helenmirren @violadavis @ellefanning @camila_cabello @ajanaomi_king @gemma_chan @evalongoria @andiemacdowell ✨
